@newenglandbrewing 🍻 
This Saturday, @hopegallerytattoo is coming to the taproom for our first ever TATS FOR TOTS fundraiser and toy drive!
From 12-7pm, four Hope Gallery artists @christian1perez @adamharmontattoo @joecapobiancotattoos @joesantiagotattoo will be doing flash tattoos in our barrel room. @littlewanderer900 will be handling @hopegallerytattoo Merch. We’ll also have music by DJ @triviacraig, permanent jewelry by @sammysparks_jewelry, and even a limited-edition batch of Sea Hag shirts and cans (designed by @joecapobiancotattoos)!!
Bring an unwrapped toy to the event and get a free pint! All toys will be donated to @yalenewhavenhealth Children’s Hospital Toy Closet and Barnard Environmental Magnet School.
@jayys_ street food will also be available. See you all there!🍺🍻🍺
